import React from "react";
import "./ResumeProfile.css"; // Add your CSS file for styling

interface ProfileProps {
  name: string;
  title: string;
  email: string;
  phone: string;
  linkedIn: string;
  summary: string;
}

const ResumeProfile: React.FC<ProfileProps> = ({
  name,
  title,
  email,
  phone,
  linkedIn,
  summary,
}) => {
  return (
    <div className="resume">
      <div className="header">
        <h1>{name}</h1>
        <h2>{title}</h2>
        <ul className="contact">
          <li>Email: {email}</li>
          <li>Phone: {phone}</li>
          <li>LinkedIn: {linkedIn}</li>
          {/* Add more contact details as needed */}
        </ul>
      </div>
      <div className="summary">
        <h3>Summary</h3>
        <p>{summary}</p>
      </div>
      {/* Add more sections for experience, education, skills, etc. */}
    </div>
  );
};

export default ResumeProfile;
